import React from 'react'
import {
  View,
  StyleSheet,
  Text,
  TouchableOpacity
} from 'react-native';

const CategoryGridTile = props => {
  return (
    <TouchableOpacity style={styles.gridList} onPress={() => {props.onSelect}}
    >
      <View>
        <Text>{props.title}</Text>
      </View>
    </TouchableOpacity>
  );
};

const styles = StyleSheet.create({
  gridList: {
    flex: 1,
    margin: 15,
    height: 150
  }
});

export default CategoryGridTile;
